<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8">
    <title>3D Box Visualization</title>
    <style>
        body { 
            margin: 0; 
            overflow: hidden;
            font-family: Arial, sans-serif;
        }
        #info {
            position: absolute;
            top: 10px;
            left: 10px;
            color: white;
            background: rgba(0,0,0,0.7);
            padding: 10px;
            border-radius: 5px;
            z-index: 100;
        }
        #controls {
            position: absolute;
            bottom: 10px;
            left: 10px;
            color: white;
            background: rgba(0,0,0,0.7);
            padding: 10px;
            border-radius: 5px;
            z-index: 100;
            font-size: 12px;
        }
        #coordinates {
            position: absolute;
            bottom: 10px;
            right: 10px;
            color: white;
            background: rgba(0,0,0,0.7);
            padding: 10px;
            border-radius: 5px;
            z-index: 100;
            font-size: 12px;
            min-width: 150px;
        }
        #tooltip {
            position: absolute;
            padding: 8px 12px;
            background: rgba(0,0,0,0.9);
            color: white;
            border-radius: 4px;
            font-size: 14px;
            pointer-events: none;
            display: none;
            z-index: 1000;
            white-space: nowrap;
        }
        #categoryPanel {
            position: absolute;
            top: 10px;
            right: 10px;
            background: rgba(26, 26, 26, 0.95);
            color: white;
            padding: 15px;
            border-radius: 8px;
            z-index: 100;
            max-height: calc(100vh - 20px);
            overflow-y: auto;
            min-width: 250px;
            max-width: 350px;
        }
        #categoryPanel h3 {
            margin: 0 0 10px 0;
            color: #4fc3f7;
            font-size: 16px;
        }
        #boxTable {
            width: 100%;
            border-collapse: collapse;
            font-size: 12px;
        }
        #boxTable th {
            background: #2a2a2a;
            padding: 6px 8px;
            text-align: left;
            font-size: 11px;
        }
        #boxTable td {
            padding: 4px 8px;
            border-bottom: 1px solid #333;
        }
        #boxTable tr:hover {
            background: rgba(79, 195, 247, 0.1);
        }
    </style>
</head>
<body>
    <div id="categoryPanel">
        <h3>Categories</h3>
        <table id="boxTable">
            <thead>
                <tr>
                    <th><input type="checkbox" id="toggleAll" checked></th>
                    <th>Category</th>
                    <th>Count</th>
                </tr>
            </thead>
            <tbody id="boxTableBody">
            </tbody>
        </table>
    </div>
    <div id="info">
        <strong>3D Box Viewer</strong><br>
        Boxes: <span id="boxCount">0</span>
    </div>
    <div id="controls">
        <strong>Controls:</strong><br>
        Left Mouse: Rotate<br>
        Right Mouse: Pan<br>
        Scroll: Zoom<br>
        <label><input type="checkbox" id="wireframe" checked> Wireframe</label>
    </div>
    <div id="coordinates">
        <div id="hovered-boxes" style="margin-bottom: 8px;"></div>
        <strong>Cursor Position:</strong><br>
        X: <span id="coord-x">-</span><br>
        Y: <span id="coord-y">-</span>
    </div>
    <div id="tooltip"></div>

            const labelScale = Math.max(150, worldSize * 0.0003);
            const labelSprite = createTextSprite(box.category, '#ffffff', labelScale);
            labelSprite.position.set(0, 0, (box.size[2] * scaleZ) / 2 + labelScale * 0.7);
            mesh.add(labelSprite);
            
            // Store data
            mesh.userData = {
                category: box.category,
                position: [worldX, worldY, worldZ],
                size: [box.size[0] * scaleX, box.size[1] * scaleY, box.size[2] * scaleZ]
            };
            
            scene.add(mesh);
            boxes.push(mesh);
        });
        
        document.getElementById('boxCount').textContent = boxes.length;
        
        // Group boxes by category
        const categoriesMap = new Map();
        boxes.forEach((mesh, index) => {
            const category = mesh.userData.category;
            if (!categoriesMap.has(category)) {
                categoriesMap.set(category, []);
            }
            categoriesMap.get(category).push(index);
        });
        
        // Populate box list table with categories
        const boxTableBody = document.getElementById('boxTableBody');
        const sortedCategories = Array.from(categoriesMap.keys()).sort();
        
        sortedCategories.forEach(category => {
            const boxIndices = categoriesMap.get(category);
            const row = document.createElement('tr');
            
            row.innerHTML = `
                <td><input type="checkbox" class="category-toggle" data-category="${category}" checked></td>
                <td>${category}</td>
                <td>${boxIndices.length}</td>
            `;
            boxTableBody.appendChild(row);
        });
        
        // Toggle box visibility by category
        document.querySelectorAll('.category-toggle').forEach(checkbox => {
            checkbox.addEventListener('change', (e) => {
                const category = e.target.dataset.category;
                const checked = e.target.checked;
                const indices = categoriesMap.get(category);
                indices.forEach(index => {
                    boxes[index].visible = checked;
                });
            });
        });
        
        // Toggle all boxes
        document.getElementById('toggleAll').addEventListener('change', (e) => {
            const checked = e.target.checked;
            document.querySelectorAll('.category-toggle').forEach(checkbox => {
                checkbox.checked = checked;
            });
            boxes.forEach(box => {
                box.visible = checked;
            });
        });
        
        // Position camera based on world size
        // Set up vector to -Y so North (-Y) appears at top of screen
        camera.up.set(0, -1, 0);
        const cameraDistance = worldSize * 0.8; // Position camera to see entire world
        camera.position.set(0, 0, cameraDistance);
        controls.target.set(0, 0, 0);
        controls.update();
        
        // Mouse position tracking
        const raycaster = new THREE.Raycaster();
        const mouse = new THREE.Vector2();
        const groundPlane = new THREE.Plane(new THREE.Vector3(0, 0, 1), 0); // Z=0 plane
        const intersectionPoint = new THREE.Vector3();
        let frozenBoxInfo = false;
        
        window.addEventListener('mousemove', (event) => {
            // Skip if frozen
            if (frozenBoxInfo) return;
            // Calculate normalized device coordinates
            mouse.x = (event.clientX / window.innerWidth) * 2 - 1;
            mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;
            
            // Update raycaster
            raycaster.setFromCamera(mouse, camera);
            
            // Check for box intersections first
            const intersects = raycaster.intersectObjects(boxes, false);
            const hoveredBoxesEl = document.getElementById('hovered-boxes');
            
            // Filter to only visible boxes
            const visibleIntersects = intersects.filter(hit => hit.object.visible);
            
            if (visibleIntersects.length > 0) {
                // Hovering over boxes - show all with coordinates
                const boxInfoHTML = visibleIntersects.map(hit => {
                    const category = hit.object.userData.category;
                    const pos = hit.object.userData.position;
                    return `<div style="color: #4fc3f7; margin-bottom: 6px; padding: 4px; background: rgba(79, 195, 247, 0.1); border-radius: 3px;">
                        <div style="font-weight: bold;">${category}</div>
                        <div style="font-size: 12px;">X: ${Math.round(pos[0])}</div>
                        <div style="font-size: 12px;">Y: ${Math.round(pos[1])}</div>
                        <div style="font-size: 12px;">Z: ${Math.round(pos[2])}</div>
                    </div>`;
                }).join('');
                hoveredBoxesEl.innerHTML = boxInfoHTML;
            } else {
                // Not hovering over a box
                hoveredBoxesEl.innerHTML = '';
            }
            
            // Find intersection with ground plane for coordinates
            if (raycaster.ray.intersectPlane(groundPlane, intersectionPoint)) {
                // Convert back to game coordinates (negate X)
                const gameX = -intersectionPoint.x;
                const gameY = intersectionPoint.y;
                
                document.getElementById('coord-x').textContent = Math.round(gameX);
                document.getElementById('coord-y').textContent = Math.round(gameY);
            }
        });
        
        // Click to freeze/unfreeze box info
        window.addEventListener('click', (event) => {
            const hoveredBoxesEl = document.getElementById('hovered-boxes');
            // Toggle frozen state if there's box info displayed or if already frozen
            if (hoveredBoxesEl.innerHTML !== '' || frozenBoxInfo) {
                frozenBoxInfo = !frozenBoxInfo;
            }
        });
        
        // Handle window resize
        window.addEventListener('resize', () => {
            camera.aspect = window.innerWidth / window.innerHeight;
            camera.updateProjectionMatrix();
            renderer.setSize(window.innerWidth, window.innerHeight);
        });
        
        // Animation loop
        function animate() {
            requestAnimationFrame(animate);
            controls.update();
            renderer.render(scene, camera);
        }
        animate();
    </script>
</body>
</html>
